CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_groupes` ()   BEGIN
    DECLARE f_id INT;
    DECLARE e_count INT;
    DECLARE g_id INT;
    DECLARE i INT;
    
    -- Cursor to iterate over formations
    DECLARE done INT DEFAULT FALSE;
    DECLARE cur CURSOR FOR SELECT id FROM formations;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO f_id;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Count students in this formation
        SET e_count = (SELECT COUNT(*) FROM etudiants WHERE formation_id = f_id);
        SET i = 0;

        WHILE i < e_count DO
            -- Create a new group
            SET g_id = LAST_INSERT_ID();

            -- Assign next 20 students to this group
            SELECT id, g_id 
            FROM etudiants 
            WHERE formation_id = f_id 
            ORDER BY id
            LIMIT 20 OFFSET i;

            SET i = i + 20;
        END WHILE;
    END LOOP;

    CLOSE cur;
END$$

